  "text" : "\uC774\uAC74 \uC0AC\uC2E4\uC0C1 \uAD6D\uBBFC\uC5F0\uAE08\uD654 \uB418\uB294 \uAC83\uACFC \uB9C8\uCC2C\uAC00\uC9C0. \uBCD1\uC0AC\uB4E4\uC758 \uC6D4\uAE09\uC5D0\uC11C \uC790\uB3D9 \uC801\uB9BD\uB41C \uAE08\uC561\uC740 \uC218\uC775 \uCC3D\uCD9C\uC744 \uC704\uD574 \uC5B4\uB518\uAC00\uC5D0 \uC4F0\uC77C \uC218\uB3C4 \uC788\uB2E4\uB294 \uB9D0\uC774 \uB418\uACE0, \uADF8 \uB3C8\uC774 \uACE0\uAC08\uB418\uC9C0 \uC54A\uC73C\uB9AC\uB780 \uBCF4\uC7A5\uC740 \uC5C6\uC74C..\n\n\uD558\uC9C0\uB9CC \uB2F9\uC7A5 \uBC8C\uC5B4\uC9C8 \uC77C\uC774 \uC544\uB2C8\uB2C8, \uC77C\uB2E8 \uC9C0\uB974\uACE0 \uBCF4\uB294 \uCABD\uC774 \uC7A5\uB561(?)",
