  "text" : "\uC774\uB85C \uC778\uD55C \uBC18\uBC1C\uC744 \uBB34\uB9C8\uD558\uAE30 \uC704\uD574 \uC81C\uB300\uAD70\uC778\uAC00\uC0B0\uC810\uC81C\uB3C4\uC758 \uBD80\uD65C \uB17C\uC7C1\uC5D0 \uBD88\uC744 \uC9C0\uD544 \uAC83\uC774 \uC608\uC0C1\uB429\uB2C8\uB2E4. \uADF8\uB7EC\uBA74 \uB610\uB2E4\uC2DC \uAD6D\uAC00\uC758 \uBAAB\uC778 '\uBCF5\uC9C0'\uAC00 \uC544\uB2C8\uB77C \uC18C\uBAA8\uC801\uC778 '\uB0A8\uB140\uAC08\uB4F1'\uC73C\uB85C \uBE44\uD654\uB420 \uAC83\uC774\uACE0, \uB0A8\uB140\uAC00 \uBC15\uD130\uC9C0\uAC8C \uC2F8\uC6B0\uB294 \uB3D9\uC548 \uAD6D\uAC00\uB294 \uB610\uB2E4\uC2DC \uD314\uC9F1 \uB07C\uACE0 \uAD6C\uACBD\uB9CC \uD558\uBA74 \uB428..",
