  "text" : "\uBA85\uB3D9\uC131\uB2F9\uC774\uB098 \uCC9C\uC8FC\uAD50\uD68C\uAC00 \uC6D0\uD574\uC11C \uADF8\uB807\uAC8C \uB41C \uAC83\uB9CC\uC740 \uC544\uB2C8\uB2E4. \uADF8\uAC83\uC740 \uC2DC\uB300\uC758 \uC694\uAD6C\uC600\uACE0, \uC2DC\uBBFC\uB4E4\uC740 \uC9C4\uC9DC \uB2EC\uB9AC \uAC08 \uB370\uAC00 \uC5C6\uC5C8\uB2E4.\n\n- \"\uC11C\uC6B8, \uBBFC\uC8FC\uD654 \uC6B4\uB3D9\uC758 \uBC1C\uC790\uCDE8\uB97C \uB530\uB77C\uC11C : \uACF5\uD3EC\uC815\uCE58\uC758 \uBB34\uB300 \uB0A8\uC0B0\uACFC \uBBFC\uC8FC\uD654\uC758 \uC131\uC9C0 \uBA85\uB3D9\uC131\uB2F9\", \uD55C\uD64D\uAD6C (\uC131\uACF5\uD68C\uB300 \uAD50\uC591\uD559\uBD80 \uAD50\uC218)",
