  "text" : "\uBC1C\uD718\uD560 \uC218 \uC5C6\uC5C8\uB2E4\u2026 \uC2DC\uBBFC\uB4E4\uC774 \uAD11\uC7A5\uC744 \uBE7C\uC557\uACBC\uB358 \uC2DC\uC808, \uC2DC\uBBFC\uB4E4\uC774 \uB2E4\uB978 \uC5B4\uB5A4 \uD53C\uB09C\uCC98\uB3C4 \uAC16\uC9C0 \uBABB\uD588\uB358 \uC554\uC6B8\uD588\uB358 \uAD70\uC0AC\uB3C5\uC7AC \uC2DC\uC808, \uBA85\uB3D9\uC131\uB2F9\uC740 \uAC00\uC2B4\uC5D0 \uB9FA\uD78C \uD55C\uC744 \uD1A0\uB85C\uD560 \uC218 \uC788\uB294 \uC544\uACE0\uB77C\uC600\uACE0, \uC0C1\uCC98 \uC785\uC740 \uC9D0\uC2B9\uC774 \uCAD3\uAE30\uACE0 \uCAD3\uACA8 \uC624\uB974\uB294 \uB098\uBB34 \uB05D\uACFC\uB3C4 \uAC19\uC740 \uACF3\uC774\uC5C8\uB2E4. \uC774\uAC83\uC740",
