  "text" : "\uD55C\uB9C8\uB514\uB85C 6\uC6D4 \uD56D\uC7C1\uC740, \uADF8\uB9AC\uACE0 \uD55C\uAD6D\uC758 \uBBFC\uC8FC\uD654 \uC6B4\uB3D9\uC740 \uBE48\uBBFC\uB4E4\uC5D0\uAC8C \uD070 \uBE5A\uC744 \uC9C0\uACE0 \uC788\uB294 \uAC83\uC774\uB2E4. \uBBFC\uC8FC\uD654 \uC6B4\uB3D9\uC740 \uB178\uB3D9\uC790\uC640 \uB18D\uBBFC, \uBE48\uBBFC\uB4E4\uC758 \uC694\uAD6C\uB97C \uBC18\uC601\uD588\uC744 \uB54C \uD798\uC744 \uBC1C\uD718\uD560 \uC218 \uC788\uC5C8\uACE0, \uC774\uB4E4\uACFC \uB3D9\uB5A8\uC5B4\uC9C4 \uCC44 \uC9C0\uC2DD\uC778\uC774\uB098 \uC6B4\uB3D9\uAC00\uB4E4\uB9CC\uC758 \uBBFC\uC8FC\uD654 \uC6B4\uB3D9\uC774 \uB418\uC5C8\uC744 \uB54C\uC5D0\uB294 \uD798\uC744",
