  "text" : "\uD559\uC0DD\uB4E4\uC744 \uB530\uB73B\uD558\uAC8C \uB9DE\uC544\uC900 \uC0AC\uB78C\uB4E4\uC740 \uC774\uB4E4\uBCF4\uB2E4 \uBA3C\uC800 \uBA85\uB3D9\uC131\uB2F9\uC5D0\uC11C \uB18D\uC131\uC744 \uD558\uACE0 \uC788\uB358  \uC0C1\uACC4\uB3D9 \uCCA0\uAC70\uBBFC\uB4E4\uC774\uC5C8\uB2E4. \uC9D1\uC744 \uCCA0\uAC70\uB2F9\uD55C \uBE48\uBBFC\uB4E4\uC774 \uC7A5\uAE30 \uB18D\uC131\uC744 \uD558\uAE30 \uC704\uD574 \uAC00\uC838\uC628 \uC300\uB85C \uC9C0\uC5B4\uC900 \uBC25\uC744 \uBA39\uC73C\uBA70 \uC2DC\uC704\uB300\uB294 \uBA85\uB3D9\uC131\uB2F9\uC5D0\uC11C \uBC84\uD17C\uB2E4. \uC774\uAC83\uC774 6\uC6D4\uD56D\uC7C1\uC758 \uBD88\uC528\uAC00 \uB41C \uAC83\uC774\uB2E4.",
