  "text" : "\uC678\uCCE4\uACE0, \uC2DC\uC704\uB300\uB294 \uC544\uBB34 \uACC4\uD68D\uC774\uB098 \uC900\uBE44, \uC9C0\uB3C4\uBD80\uB3C4 \uC5C6\uC774 \uADF8\uB0E5 \uBA85\uB3D9\uC131\uB2F9\uC73C\uB85C \uBAB0\uB824\uAC14\uB2E4. \uB18D\uC131\uC740 \uADF8\uB807\uAC8C \uC2DC\uC791\uB418\uC5C8\uACE0, \uC774 \uB18D\uC131\uC774 \uC5C6\uC5C8\uB354\uB77C\uBA74 1987\uB144\uC5D0 \uADF8 \uB728\uAC70\uC6B4 6\uC6D4\uD56D\uC7C1\uC774 \uAC00\uB2A5\uD588\uC744\uB294\uC9C0\uB97C \uC544\uBB34\uB3C4 \uC7A5\uB2F4\uD560 \uC218 \uC5C6\uC744 \uAC83\uC774\uB2E4.\n\n\uC544\uBB34\uB7F0 \uC900\uBE44 \uC5C6\uC774 \uB18D\uC131\uC744 \uC2DC\uC791\uD55C \uC2DC\uBBFC\uACFC",
