  "text" : "\uC9C1\uC811\uC801\uC778 \uB3C4\uD654\uC120\uC744 \uC81C\uACF5\uD55C \uBA85\uB3D9\uC131\uB2F9\uC740 6\uC6D4 10\uC77C \uB2E4\uC2DC \uD55C\uBC88 \uC2DC\uB300\uC758 \uD750\uB984\uC744 \uBC14\uAFD4 \uB193\uB294 \uC5ED\uC0AC\uC758 \uD604\uC7A5\uC774 \uB418\uC5C8\uB2E4. 6\uC6D4 10\uC77C\uC758 \uAD6D\uBBFC\uB300\uD68C\uB294 \uB9E4\uC6B0 \uC131\uACF5\uC801\uC73C\uB85C \uCE58\uB904\uC84C\uC9C0\uB9CC, \uADF8 \uC911 \uC218\uBC31\uBA85\uC758 \uC2DC\uBBFC\uB4E4\uC740 \uADF8\uB300\uB85C \uBC1C\uAE38\uC744 \uB3CC\uB9B4 \uC218 \uC5C6\uC5C8\uB2E4. \uB204\uAD70\uAC00\uAC00 \"\uBA85\uB3D9\uC131\uB2F9\uC73C\uB85C \uAC00\uC790\"\uB77C\uACE0",
