  "text" : "\uC131\uD0C4\uC808 \uBBF8\uC0AC \uC0DD\uC911\uACC4\uB97C \uACF5\uC911\uD30C TV\uC5D0\uC11C \uBCFC \uC218 \uC5C6\uC5C8\uB2E4\u2026 \uBC15\uC815\uD76C \uC815\uAD8C\uC740 1974\uB144 \uC6D0\uC8FC\uAD50\uAD6C\uC758 \uC9C0\uD559\uC21C \uC8FC\uAD50\uB97C \uBBFC\uCCAD\uD559\uB828 \uD559\uC0DD\uB4E4\uC5D0\uAC8C \uC2DC\uC704\uC790\uAE08\uC744 \uC8FC\uC5C8\uB2E4\uB294 \uC774\uC720\uB85C \uAD6C\uC18D\uD574 \uBC84\uB838\uB2E4. \uC774 \uB9CC\uD589\uC740 \uC80A\uC740 \uC2E0\uBD80\uB4E4\uC744 \uC790\uADF9\uD558\uC5EC \uCC9C\uC8FC\uAD50\uC815\uC758\uAD6C\uD604\uC0AC\uC81C\uB2E8\uC774 \uACB0\uC131\uB418\uB294 \uACC4\uAE30\uAC00 \uB418\uC5C8\uB2E4\u2026",
