  "text" : "\uC6B0\uB9AC\uB098\uB77C\uB294 \uB3C5\uC7AC \uC544\uB2C8\uBA74 \uD3ED\uB825 \uD601\uBA85\uC774\uB780 \uC591\uC790\uD0DD\uC77C\uC758 \uAE30\uB9C9\uD78C \uC6B4\uBA85\uC5D0 \uC9C1\uBA74\uD560\uC9C0\uB3C4 \uBAA8\uB985\uB2C8\uB2E4. \uC815\uBD80\uC640 \uC5EC\uB2F9\uC5D0\uAC8C \uBB3B\uACA0\uC2B5\uB2C8\uB2E4. \uBE44\uC0C1 \uB300\uAD8C\uC744 \uB300\uD1B5\uB839\uC5D0\uAC8C \uC8FC\uB294 \uAC83\uC774 \uB098\uB77C\uB97C \uC704\uD574 \uC720\uC775\uD55C \uC77C\uC785\uB2C8\uAE4C?\"\uB77C\uACE0 \uAC15\uB3C4 \uB192\uAC8C \uBC15\uC815\uD76C \uC815\uAD8C\uC744 \uBE44\uD310\uD588\uB2E4. \uC0DD\uC911\uACC4\uB294 \uC911\uB2E8\uB418\uC5C8\uACE0, \uC774\uB4EC\uD574\uBD80\uD130\uB294",
