  "text" : "\uD55C\uAD6D\uC758 \uCC9C\uC8FC\uAD50\uD68C\uB294 \uB3C5\uB9BD\uC6B4\uB3D9\uC5D0 \uAE30\uC5EC\uD55C \uBC14\uAC00 \uBCC4\uB85C \uC5C6\uB2E4. \uADF8\uB7EC\uB098 \uBBFC\uC8FC\uD654\uC6B4\uB3D9\uC5D0 \uB300\uD574\uC11C\uB294 \uCC9C\uC8FC\uAD50\uC758 \uC5ED\uD560\uC744 \uB5A0\uB098\uC11C \uD55C\uAD6D \uBBFC\uC8FC\uD654\uC6B4\uB3D9\uC744 \uC0DD\uAC01\uD560 \uC218 \uC5C6\uC744 \uB9CC\uD07C \uC5C4\uCCAD\uB09C \uAE30\uC5EC\uB97C \uD588\uB2E4\u2026 \uC720\uC2E0 \uC774\uD6C4 \uBAA8\uB4E0 \uC0AC\uB78C\uB4E4\uC774 \uAC81\uC5D0 \uC9C8\uB824 \uCE68\uBB35\uC5D0 \uBE60\uC838 \uC788\uC744 \uB54C \uC720\uC2E0\uC815\uAD8C\uC744 \uC815\uBA74\uC5D0\uC11C \uBE44\uD310\uD55C",
