  "text" : "\uC2EC\uC9C0\uC5B4 \uC800 \uB458 \uC911 \uD55C \uBD84\uC758 \uACBD\uC6B0, \uADF8 \uBD84\uC758 \uD314\uB85C\uC6CC\uB4E4\uC774\uB098 \uB098\uC758 \uD314\uB85C\uC6CC\uB4E4\uC5D0\uAC8C\uC11C \uADF8\uC758 \uACF5\uAC1C\uC801 \uBE44\uBC29\uD589\uC704\uC5D0 \uB300\uD55C \uC9C0\uC801\uC744 \uBC1B\uC544 \uBCF8 \uC801\uC774 \uC774\uBC88\uC774 \uCC98\uC74C\uC774 \uC544\uB2C8\uB2E4. \uC774\uB807\uAC8C\uAE4C\uC9C0 \uC21C\uC218\uD558\uAC8C \uC545\uC758\uB85C\uB9CC \uAC00\uB4DD \uCC2C \uC9C0\uC18D\uC801 \uBE44\uB09C\uC744 \uBC1B\uC544\uBCF8 \uACBD\uD5D8\uC774 \uC5C6\uC5B4 \uACF5\uD669\uB9C8\uC800 \uB290\uB080\uB2E4. \uACAC\uB514\uAE30 \uD798\uB4E4\uB2E4",
