  "text" : "\uC904 \uBAB0\uB790\uB2E4\uB294 \uCC29\uC624\uC5D0 '\uC815\uB2F9\uD55C \uC774\uC720\uAC00 \uC788\uC5C8\uB2E4'\uACE0 \uBCF4\uAE30\uC5D0\uB294 \uC5EC\uB7EC\uBAA8\uB85C \uBB34\uB9AC\uAC00 \uC544\uB2C8\uACA0\uB098 \uBB50 \uADF8\uB807\uAC8C \uC0DD\uAC01\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4. \uC0AC\uD68C\uD1B5\uB150\uC0C1 \uADF8\uAC8C \uC815\uC0C1\uC801\uC778 \uBC1C\uC0C1\uC740 \uC544\uB2C8\uC796\uC544\uC694? \uAD73\uC774 \uBC18\uBC15\uB300\uC790\uBCF4\uB97C \uBD99\uC774\uC9C0 \uC54A\uB354\uB77C\uB3C4, \uB300\uD559\uBCF8\uBD80\uB098 \uB2E8\uACFC\uB300 \uCE21\uC5D0 \uBB38\uC758\uD558\uACE0 \uCCA0\uAC70\uB97C \uC694\uAD6C\uD558\uB294\uAC8C \uC6B0\uC120\uC774\uC9C0.",
