  "text" : "\uADF8\uB54C \uB0B4\uAC00 \uB290\uB080\uAC8C \uBB50\uB0D0\uBA74, \uAD73\uC774 \uB0A8\uB4E4\uC774 \uB514\uC2A4\uD558\uC9C0 \uC54A\uC544\uB3C4 \uCE5C\uB178 \uC9C4\uC601\uC740 '\uC720\uB09C\uC2A4\uB7EC\uC6C0'\uACFC '\uC124\uB808\uBC1C'\uC744 \uD1B5\uD574 \uC2A4\uC2A4\uB85C\uAC00 \uC548\uD2F0\uB97C \uC591\uC0B0\uD574 \uB0B8\uB2E4\uB294 \uAC83\uC774\uC5C8\uC74C.\n\n\uADF8\uAC74 \uBB50 \uC815\uCE58\uC778\uC774 \uC544\uB2CC \uC0C1\uB2F9\uC218\uC758 \uC9C0\uC9C0\uC790\uB4E4\uC5D0\uAC8C\uB3C4 \uD574\uB2F9\uB418\uB294 \uC810 \uAC19\uACE0.. \uADF8\uAC78 \uC601\uD654 \uBCC0\uD638\uC778 \uD64D\uBCF4\uC5D0\uC11C \uB610 \uBCF4\uB294 \uC911",
