  "text" : "\"\uC544~ \uC528\uBC1C \uB178\uBB34\uD604~ \uC544~ \uC6B0\uB9AC\uAC00 \uC774\uACBC\uC2B5\uB2C8\uB2E4\" \uBB50 \uC5B4\uCA4C\uAD6C \uC800\uCA4C\uAD6C \uD558\uB358 \uC2DC\uC600\uC74C. \uB0B4\uAC00 \uC2DC\uC5D0 \uB300\uD574\uC11C\uB294 \uBB38\uC678\uD55C\uC778\uC9C0\uB77C \uC2DC\uC758 \uC758\uB3C4\uAC00 \uBB50\uC600\uB294\uC9C0\uB294 \uBAA8\uB974\uACA0\uACE0, \uADF8\uB0E5 '\uC774\uAC83\uB4E4\uC740 \uB300\uCCB4 \uBB50\uC9C0..' \uD558\uB294 \uC0DD\uAC01\uBC16\uC5D0 \uC548\uB0AC\uC5C8\uC74C.\n\n\uADF8\uB7EC\uBA74\uC11C \uC124\uB808\uBC1C\uCE58\uB2E4\uAC00 \uAC15\uB0A83\uAD6C\uC5D0\uC11C \uB4A4\uC9D1\uD788\uACE0 \uD574\uC0B0",
