  "text" : "\uC9C0\uB09C 2010 \uC11C\uC6B8\uC2DC\uC7A5 \uC120\uAC70\uC600\uC5C8\uB098? \uC911\uBC18\uAE4C\uC9C0\uB9CC \uD574\uB3C4 \uD55C\uBA85\uC219\uC528\uAC00 \uC624\uC138\uD6C8\uC528\uB97C \uC55E\uC11C\uACE0 \uC788\uC5C8\uACE0, \uC774\uC5D0 \uACE0\uBB34\uB41C \uC9C0\uC9C0\uC790\uB4E4\uC774 \uC11C\uC6B8\uAD11\uC7A5\uC5D0 \uBAA8\uC5EC\uC11C \uAC1C\uD45C\uBC29\uC1A1\uC744 \uC9C0\uCF1C\uBCF4\uBA70 \uBB54 \uBB38\uD654\uC81C\uB97C \uBC8C\uC600\uC5C8\uB294\uB370..\n\n\uB09C \uC544\uC9C1\uB3C4 \uADF8\uB54C \uB204\uAD70\uAC00 \uC55E\uC5D0 \uB098\uC640 \uB0AD\uC1A1\uD55C \uC2DC\uB97C \uC78A\uC9C0 \uBABB\uD568. \uADF8\uAC8C \uBB50\uC600\uB0D0\uBA74",
