  "text" : "\uC815\uB2F9\uBC29\uC704\uC640 \uAD00\uB828\uD558\uC5EC \uACF5\uAC10\uC744 \uC5BB\uAE30\uB3C4 \uD798\uB4E4\uBA70 \uAD6C\uCCB4\uC801\uC778 \uAE30\uC900\uC744 \uC81C\uC2DC\uD558\uC9C0\uB3C4 \uBABB\uD55C\uB2E4.\n\n- \uC2F8\uC6C0\uC5D0 \uC788\uC5B4\uC11C \uC815\uB2F9\uBC29\uC704\uC758 \uD655\uB300, \uAE40\uBCD1\uC218, \uBD80\uC0B0\uB300\uD559\uAD50 \uBC95\uD559\uC5F0\uAD6C\uC18C \uC5F0\uAD6C\uAD50\uC218\n\n\uCC38\uACE0\uB85C \uC5B8\uAE09\uB41C 14\uAC74\uC740 2012.8.3\uAE4C\uC9C0 \uB300\uBC95\uC6D0\uC885\uD569\uBC95\uB960\uC815\uBCF4\uC11C\uBE44\uC2A4\uC5D0\uC11C \uC815\uB2F9\uBC29\uC704\uB85C \uAC80\uC0C9\uD55C \uACB0\uACFC\uB77C\uACE0",
