  "text" : "\uAC83\uC740 \uACB0\uAD6D \uAD6D\uBBFC\uB4E4\uC758 \uAD8C\uB9AC\uBCF4\uD638\uC5D0 \uBBF8\uD761\uD558\uC600\uB2E4\uB294 \uAC83\uC774 \uB41C\uB2E4. \uC774\uB7EC\uD55C \uBB38\uC81C\uC810\uB4E4\uC758 \uADFC\uC800\uC5D0\uB294 \uBC95\uC6D0\uC774 \uC815\uB2F9\uBC29\uC704\uC758 \uC0C1\uB2F9\uC131 \uD310\uB2E8\uC5D0 \uB300\uD558\uC5EC \uAD6C\uCCB4\uC801\uC774\uC9C0 \uBABB\uD558\uC600\uACE0 \uD559\uACC4\uC5D0\uC11C\uB3C4 \uC0C1\uB2F9\uC131 \uD310\uB2E8\uC5D0 \uAD00\uD558\uC5EC \uC774\uB860\uC774 \uC81C\uB300\uB85C \uC815\uB9BD\uB418\uC9C0 \uBABB\uD55C \uAC83\uC5D0 \uC6D0\uC778\uC774 \uC788\uB2E4. \uC774\uB7F0 \uC0C1\uD669\uC774\uB77C\uBA74 \uAD6D\uBBFC\uB4E4\uC5D0\uAC8C",
