  "text" : "\uC0AC\uB840\uB294 14\uAC74\uC5D0 \uBD88\uACFC\uD558\uB2E4. \uC774\uAC83\uC740 \uC18C\uADF9\uC801 \uC800\uD56D\uD589\uC704\uB97C \uBC29\uC5B4\uD589\uC704\uB85C\uC11C \uC815\uB2F9\uBC29\uC704\uB85C \uC778\uC815\uD55C \uAC83\uC774 \uC544\uB2C8\uB77C \uD615\uBC95 \uC81C20\uC870\uC758 \uC0AC\uD68C\uC0C1\uADDC\uC5D0 \uC758\uD55C \uC815\uB2F9\uD589\uC704\uB85C \uD30C\uC545\uD588\uAE30 \uB54C\uBB38\uC774\uBA70, \uC2F8\uC6C0\uC758 \uACBD\uC6B0 \uC6D0\uCE59\uC801\uC73C\uB85C \uC815\uB2F9\uBC29\uC704\uB97C \uC778\uC815\uD558\uC9C0 \uC54A\uC558\uAE30 \uB54C\uBB38\uC774\uB2E4. \uC815\uB2F9\uBC29\uC704\uB85C \uC778\uC815\uB41C \uACBD\uC6B0\uAC00 \uC801\uB2E4\uB294",
