  "text" : "\uB4EF\uD558\uB2E4. \uBD84\uB370\uC2A4\uBC18\uACFC \uBD84\uB370\uC2A4\uD3EC\uC2A4\uD2B8\uC758 \uBBFC\uC601\uD654 \uC774\uD6C4 \uAC00\uC7A5 \uC911\uC694\uD55C \uBBFC\uC601\uD654\uB294 \uC5D0\uB108\uC9C0 \uC0B0\uC5C5\uC5D0\uC11C \uC77C\uC5B4\uB0AC\uB2E4(Ridder 2003). \uC804\uAE30\uACF5\uAE09\uACFC \uAC00\uC2A4\uACF5\uAE09\uC740 \uC9C0\uBC29\uC790\uCE58\uCCB4\uC758 \uB3C4\uC2DC\uACF5\uC0AC(Stadtwerke)\uB85C\uBD80\uD130 \uB3C5\uC77C \uC804\uCCB4\uB97C \uB124 \uC9C0\uC5ED\uC73C\uB85C \uBD84\uD560\uD558\uACE0 \uC788\uB294 \uB124 \uAC1C\uC758 \uC5D0\uB108\uC9C0 \uD68C\uC0AC",
