  "text" : "\uC7A0\uC7AC\uC801 \uBC18\uB300\uC790, \uC989 \uC0AC\uBBFC\uB2F9\uC740 \uBB3C\uB860 \uB178\uB3D9\uC870\uD569\uC5D0\uAC8C\uB3C4 \uAC70\uC5ED\uD560 \uC218 \uC5C6\uB294 \uD798\uC73C\uB85C \uBE44\uCCD0\uC84C\uB2E4.\n\n1998\uB144 \uC0AC\uBBFC\u00B7\uB179\uC0C9\uC5F0\uC815\uC758 \uC9D1\uAD8C \uC774\uD6C4\uC5D0\uB3C4 \uBBFC\uC601\uD654\uC758 \uBB3C\uACB0\uC740 \uADF8\uCE58\uC9C0 \uC54A\uC558\uB2E4. \uCCA0\uB3C4\u00B7\uC6B0\uD3B8\u00B7\uC815\uBCF4\uD1B5\uC2E0 \uC601\uC5ED\uC758 \uAD6D\uAC00\uB3C5\uC810\uC774 \uBB34\uB108\uC9C0\uBA74\uC11C \uB354 \uC774\uC0C1 \uBBFC\uC601\uD654\uC5D0 \uB300\uD55C \uD0C0\uBD80\uB294 \uC874\uC7AC\uD558\uC9C0 \uC54A\uB294",
