  "text" : "\uB2E8 \uACA9\uC774 \uB418\uC5C8\uB2E4. \uD2B9\uD788 \uC720\uB7FD\uD1B5\uD569\uC740 \uB2E4\uB978 \uD68C\uC6D0\uAD6D\uB4E4\uACFC \uB354\uBD88\uC5B4 \uB3C5\uC77C\uC5D0\uC11C\uB3C4 \uC2E0\uC790\uC720\uC8FC\uC758\uC801\u00B7\uACBD\uC7C1\uC801 \uC7AC\uD3B8\uC758 \uC9C0\uB81B\uB300\uB85C \uC791\uC6A9\uD588\uACE0, \uACF5\uACF5\uC601\uC5ED\uC758 \uC790\uC720\uD654\u00B7\uD0C8\uADDC\uC81C\u00B7\uBBFC\uC601\uD654\uC758 \uCD94\uB3D9\uB825\uC774 \uB418\uC5C8\uB2E4. \uC720\uB7FD\uC5F0\uD569\uC758 \uC9C0\uCE68\uB4E4\uC740 \uC0AC\uC2E4\uC0C1 \uBBFC\uC601\uD654\uC758 \uBC29\uD5A5\uACFC \uB0B4\uC6A9\uC744 \uACB0\uC815\uC9D3\uACE0 \uC788\uC5C8\uACE0, \uB610\uD55C \uBBFC\uC601\uD654\uC758",
