  "text" : "\uBBF8\uB798\uC5D0 \uB300\uD55C \uC900\uBE44\uC640 \uC5F0\uACC4\uC2DC\uD0A4\uB294 \uB370\uC5D0 \uC131\uACF5\uD568\uC73C\uB85C\uC368 \uBBFC\uC601\uD654\uC5D0 \uB300\uD55C \uBC18\uB300\uC758 \uB2F4\uB860\uC744 \uC870\uC9C1\uC774\uAE30\uC8FC\uC758 \uB610\uB294 \uAE30\uB4DD\uAD8C\uC758 \uBCF4\uC804\uACFC \uAC19\uC740 \uACFC\uAC70\uC9C0\uD5A5\uC801\uC778 \uAC83\uC73C\uB85C \uC555\uB3C4\uD560 \uC218 \uC788\uC5C8\uB2E4. \uB3C5\uC77C\uD1B5\uC77C\uC758 \uC644\uC131\uACFC \uC720\uB7FD\uD1B5\uD569\uC758 \uC2EC\uD654\uB77C\uB294 \uC644\uC804\uD788 \uC0C8\uB85C\uC6B4 \uD658\uACBD\uC758 \uB4F1\uC7A5\uACFC \uD568\uAED8 \uBBFC\uC601\uD654\uB294 \uC21C\uD48D\uC5D0 \uB3DB\uC744",
