  "text" : "\uC8FC\uBCC0 \uD658\uACBD\uC758 \uADFC\uBCF8\uC801 \uBCC0\uD654\uB77C\uB294 \uB450 \uC694\uC778\uACFC\uB3C4 \uAE4A\uC740 \uC0C1\uAD00\uC774 \uC788\uB2E4. \uBBFC\uC601\uD654\uC5D0 \uB300\uD55C \uC9C0\uC9C0\uB294 1990\uB144\uB300 \uCD08\uBC18 \uC0DD\uC0B0\uC785\uC9C0\uB17C\uC7C1\uC744 \uD1B5\uD574 \uBC1C\uD718\uB41C \uC2E0\uC790\uC720\uC8FC\uC758\uC801 \uACBD\uC7C1\uB825 \uB2F4\uB860\uC758 \uAC15\uD55C \uD638\uC18C\uB825\uC5D0 \uD06C\uAC8C \uACE0\uBB34\uB418\uC5C8\uB2E4. \uACBD\uC7C1\uB825 \uB2F4\uB860\uC740 \uB300\uB2E8\uD788 \uACF5\uC138\uC801\uC73C\uB85C \uC0DD\uC0B0\uC785\uC9C0\uC758 \uAC15\uD654\uB97C",
