  "text" : "\uCD94\uC9C4\uB420 \uC218 \uC788\uC5C8\uB2E4. \uBC29\uB300\uD55C \uCC44\uBB34\uC5D0 \uC2DC\uB2EC\uB9AC\uB358 \uBD84\uB370\uC2A4\uBC18\uC758 \uACBD\uC6B0 \uB178\uC870\uC870\uCC28 \uCC44\uBB34\uC758 \uD0D5\uAC10\uC774\uB77C\uB294 \uC804\uC81C \uC544\uB798 \uBBFC\uC601\uD654\uB97C \uC9C0\uC9C0\uD558\uACE0 \uB098\uC130\uB358 \uC810\uB3C4 \uD765\uBBF8\uB86D\uB2E4.\n\n\uB3C5\uC77C\uC5D0\uC11C \uBBFC\uC601\uD654\uAC00 \uC0C1\uB300\uC801\uC73C\uB85C \uC6D0\uB9CC\uD558\uAC8C \uCD94\uC9C4\uB420 \uC218 \uC788\uC5C8\uB358 \uAC83\uC740 \uBBFC\uC601\uD654 \uC804\uB7B5\uBFD0\uB9CC \uC544\uB2C8\uB77C, \uC9C0\uBC30\uB2F4\uB860\uC758 \uD2B9\uC9D5 \uBC0F",
