  "text" : "\uD588\uB358 \uC601\uAD6D\uC5D0 \uBE44\uD574 \uCF5C \uC815\uBD80\uAC00 \uCD94\uC9C4\uD55C \uBBFC\uC601\uD654\uB294 \uD615\uC2DD\uC801 \uBBFC\uC601\uD654\uB97C \uAC70\uCCD0 \uBB3C\uC9C8\uC801 \uBBFC\uC601\uD654\uB85C \uAC00\uB294 \uB2E8\uACC4\uC801 \uC774\uD589\uC804\uB7B5\uC744 \uD0DD\uD588\uB2E4. \uB178\uC870\uC758 \uC800\uD56D\uACFC \uBC18\uBC1C\uC740 \uC5B5\uC555\uB418\uAE30\uBCF4\uB2E4\uB294 \uACBD\uCCAD\uB418\uC5C8\uACE0, \uACE0\uC6A9\uBCF4\uC7A5 \uBC0F \uACF5\uBB34\uC6D0\uC774\uB77C\uB294 \uD2B9\uC218\uD55C \uC9C0\uC704\uB97C \uC778\uC815\uD558\uB294 \uD0C0\uD611\uC744 \uD1B5\uD574 \uC804\uBC18\uC801\uC73C\uB85C \uD070 \uAC08\uB4F1 \uC5C6\uC774",
