  "text" : "\"\uB3D9\uC131\uAC04 \uBCC0\uD0DC\uC131\uD589\uC704\uB97C \uBC94\uC8C4\uB85C \uADDC\uC815\uD558\uB294 Georgia\uC8FC\uBC95\uC744 \uD569\uD5CC\uC774\uB77C \uD310\uC2DC\uD55C Bowers \uC0AC\uAC74\uC740 \uACB0\uC815\uB420 \uB54C \uD2C0\uB838\uACE0, \uC624\uB298\uC5D0\uB3C4 \uD2C0\uB9AC\uB2E4. \uADF8 \uC0AC\uAC74\uC740 \uBC88\uBCF5\uB418\uC5B4\uC57C \uD558\uACE0 \uC9C0\uAE08 \uBC88\uBCF5\uB418\uC5C8\uB2E4.\"\n\n-  Lawrence v. Texas, 539 U.S. 558(2003)",
