  "text" : "\uCC28\uBCC4\uBC1B\uAC8C \uD558\uB294 \uCD08\uB300\uC7A5\uC774\uB2E4. Bowers \uC0AC\uAC74\uC744 \uC120\uB840\uB85C\uC11C \uC9C0\uC18D\uC2DC\uD0A4\uB294 \uAC83\uC740 \uB3D9\uC131\uC560\uC790\uB4E4\uC758 \uC0B6\uC744 \uD3C4\uD6FC\uD558\uB294 \uAC83\uC774\uB2E4.\n\nBowers \uC0AC\uAC74\uC740 \uACB0\uC815\uB420 \uB54C \uD2C0\uB838\uACE0, \uC624\uB298\uC5D0\uB3C4 \uD2C0\uB9AC\uB2E4. \uADF8 \uC0AC\uAC74\uC740 \uBC88\uBCF5\uB418\uC5B4\uC57C \uD558\uACE0 \uC9C0\uAE08 \uBC88\uBCF5\uB418\uC5C8\uB2E4.\n\n-  Lawrence v. Texas",
