  "text" : "\uD3C9\uB4F1\uCDE8\uAE09\uC744 \uBC1B\uC744 \uAD8C\uB9AC \uBC0F \uC801\uBC95\uC808\uCC28\uAD8C\uB9AC\uB294 \uC911\uC694\uD55C \uC810\uC5D0\uC11C \uC5F0\uACB0\uB418\uC5B4 \uC788\uC73C\uBA70, \uC801\uBC95\uC808\uCC28\uAD8C\uB9AC\uC5D0 \uB300\uD55C \uACB0\uC815\uC740 \uC774 2\uAC00\uC9C0 \uC774\uC775\uC744 \uBAA8\uB450 \uCD09\uC9C4\uD55C\uB2E4. \uC8FC\uBC95\uC774 \uB3D9\uC131\uAC04 \uBCC0\uD0DC\uC131\uD589\uC704\uB97C \uBC94\uC8C4\uB85C \uADDC\uC815\uD558\uB294 \uACBD\uC6B0, \uC774\uB294 \uADF8 \uC790\uCCB4\uB85C \uADF8\uB9AC\uACE0 \uC790\uB3D9\uC801\uC73C\uB85C \uACF5\uC801 \uBC0F \uC0AC\uC801 \uC601\uC5ED\uC5D0\uC11C \uB3D9\uC131\uC560\uC790\uB4E4\uC744",
