  "text" : "\uD3C9\uB4F1\uBCF4\uD638 \uC870\uD56D \uD558\uC5D0\uC11C \uC774 \uC0AC\uAC74\uC758 \uC2EC\uD310\uB300\uC0C1\uC778 \uBC95\uC744 \uBB34\uD6A8\uB77C\uACE0 \uD310\uACB0\uD558\uBA74, \uC77C\uBD80 \uC0AC\uB78C\uB4E4\uC740 \uB3D9\uC131\uAC04 \uD589\uC704\uC640 \uC774\uC131\uAC04 \uD589\uC704 \uBAA8\uB450\uB97C \uAE08\uC9C0\uD558\uBA74, \uC774\uAC83\uC740 \uC720\uD6A8\uD55C\uC9C0 \uC5EC\uBD80\uC5D0 \uB300\uD574 \uC758\uBB38\uC744 \uAC00\uC9C8\uC9C0\uB3C4 \uBAA8\uB978\uB2E4. \uC2E4\uCCB4\uC801 \uBCF4\uC7A5\uC5D0 \uC758\uD574 \uBCF4\uD638\uB418\uB294 \uC790\uC720 \uD589\uC0AC\uC5D0 \uB300\uD574 \uC874\uC911\uC744 \uC694\uAD6C\uD558\uB294,",
