  "text" : "\uC218\uC815\uD5CC\uBC95 \uC81C14\uC870\uAC00 \uBCF4\uD638\uD558\uB294 \uC790\uC720\uC758 \uD575\uC2EC\uC774\uB77C\uACE0 \uD558\uC600\uB2E4. \uB3D9\uC131\uC560\uC790\uB4E4\uB3C4 \uC774\uC131\uC560\uC790\uB4E4\uACFC \uB611\uAC19\uC774 \uC790\uC728\uC744 \uCD94\uAD6C\uD560 \uC218 \uC788\uB2E4.\n\n\uB458\uC9F8, Romer \uC0AC\uAC74\uC5D0\uC11C \uBBF8\uC5F0\uBC29\uB300\uBC95\uC6D0\uC740 \uC218\uC8152\uC870\uB294 \uB3D9\uC131\uC560\uC790\uC5D0 \uB300\uD55C \uC801\uC758\uC5D0\uC11C \uB9CC\uB4E4\uC5B4\uC84C\uACE0 \uC815\uB2F9\uD55C \uC815\uBD80 \uBAA9\uC801\uACFC \uD569\uB9AC\uC801 \uAD00\uB828\uC774 \uC5C6\uB2E4\uACE0 \uD558\uC600\uB2E4.",
