  "text" : "25\uAC1C \uC8FC\uB4E4\uC774 \uBCC0\uD0DC\uC131\uD589\uC704\uAE08\uC9C0\uBC95\uC744 \uAC16\uACE0 \uC788\uC5C8\uB294\uB370, \uC9C0\uAE08\uC740 13\uAC1C \uC8FC\uB85C \uC904\uC5B4\uB4E4\uC5C8\uACE0 \uADF8 \uC911 4\uAC1C \uC8FC\uB294 \uB3D9\uC131\uAC04 \uBCC0\uD0DC\uC131\uD589\uC704\uC5D0 \uB300\uD574\uC11C\uB9CC \uBC95\uC744 \uC9D1\uD589\uD55C\uB2E4. \uB3D9\uC131\uAC04\uC774\uB4E0 \uC774\uC131\uAC04\uC774\uB4E0 \uBCC0\uD0DC\uC131\uD589\uC704\uB97C \uC5EC\uC804\uD788 \uAE08\uC9C0\uD558\uB294 \uC8FC\uB4E4\uC5D0\uC11C\uB3C4, \uC0AC\uC801 \uD569\uC758\uC5D0 \uC758\uAC70\uD558\uC5EC \uD589\uD558\uB294 \uC131\uC778\uB4E4\uC5D0 \uB300\uD574\uC11C\uB294",
