  "text" : "\uC790\uC2E0\uB4E4\uC758 \uC0AC\uC0DD\uD65C\uC744 \uC5B4\uB5BB\uAC8C \uC601\uC704\uD560\uC9C0\uB97C \uACB0\uC815\uD568\uC5D0 \uC788\uC5B4\uC11C, \uC790\uC720\uB294 \uC131\uC778\uB4E4\uC5D0\uAC8C \uC2E4\uC9C8\uC801 \uBCF4\uD638\uB97C \uBD80\uC5EC\uD55C\uB2E4\uB294 \uC778\uC2DD\uC774 \uCD9C\uD604\uD558\uC600\uC74C\uC774 \uB4DC\uB7EC\uB09C\uB2E4.\n\n\uBBF8\uAD6D \uD5CC\uBC95\uCCB4\uC81C\uC5D0\uC11C Bowers \uC0AC\uAC74 \uD310\uACB0\uC774 \uC9C0\uB2CC \uD558\uC790\uB294 \uD310\uACB0\uC120\uACE0 \uD6C4\uC5D0 \uD6E8\uC52C \uB354 \uBD84\uBA85\uD574\uC84C\uB2E4. Bowers \uC0AC\uAC74 \uB2F9\uC2DC\uC5D0",
