  "text" : "\uC5EC\uD2BC, \uC774 \uC0AC\uAC74\uC5D0 \uB300\uD574\uC11C \uD574\uC678\uC5D0\uC11C\uB3C4 \uD765\uBBF8\uC9C4\uC9C4\uD558\uAC8C \uC9C0\uCF1C\uBCF4\uACE0 \uC788\uAE30 \uB54C\uBB38\uC5D0 \uBC95\uC6D0\uC740 \uD070 \uBD80\uB2F4\uC744 \uC5C5\uACE0 \uD310\uB2E8\uC5D0 \uC784\uD560 \uC218 \uBC16\uC5D0 \uC5C6\uC744 \uB4EF. \uAC8C\uB2E4\uAC00 \uC18C\uC1A1\uC758 \uACB0\uACFC\uC640\uB294 \uC0C1\uAD00 \uC5C6\uC774 \uC2EC\uD310\uC5D0 \uAD00\uC5EC\uD55C \uBC95\uAD00\uC774\uB098 \uC18C\uC1A1\uB300\uB9AC\uC778\uB4E4\uC758 \uBC1C\uC5B8\uC774\uB098 \uC2E0\uC0C1 \uB4F1\uC774 \uAE4C\uBC1C\uB824\uC9C8 \uAC83\uC774 \uC608\uC0C1\uB418\uC5B4 \uAC71\uC815\uB418\uACE0..",
