  "text" : "\uC9D1\uB2E8\uC801\uC778 \uD3ED\uD589\u00B7\uC190\uAD34 \uD589\uC704 \uB4F1\uC774 \uBC1C\uC0DD\uD560 \uAC1C\uC5F0\uC131\uC774 \uB192\uB2E4\uACE0 \uBCF4\uAE30 \uC5B4\uB835\uACE0, \uD53C\uACE0\uAC00 \uC8FC\uC7A5\uD558\uB294 \uC0AC\uC815\uC774 \uC774 \uC0AC\uAC74 \uAE08\uC9C0\uAD6C\uC5ED\uC5D0\uC11C\uC758 \uC774 \uC0AC\uAC74 \uC9D1\uD68C\uB97C \uAE08\uC9C0\uD560 \uC218 \uC788\uB294 \uC0AC\uC720\uC5D0 \uD574\uB2F9\uD55C\uB2E4\uACE0 \uBCF4\uAE30\uB3C4 \uC5B4\uB835\uB2E4. \/ \uC774 \uC0AC\uAC74 \uBB3C\uAC74\uB4E4\uC740 \uB3C4\uB85C\uC810\uC6A9\uD5C8\uAC00 \uB300\uC0C1\uC5D0 \uD574\uB2F9\uD558\uC9C0 \uC54A\uB294\uB2E4\uACE0 \uD560 \uAC83\uC774\uB2E4",
