  "text" : "\uC7A5\uC18C\uC758 \uC911\uC694\uC131\uC740 \uB69C\uB837\uD558\uAC8C \uB4DC\uB7EC\uB09C\uB2E4. \uC774\uB807\uB4EF \uC9D1\uD68C \uC7A5\uC18C\uB294 \uC9D1\uD68C\uC758 \uBAA9\uC801\uACFC \uD6A8\uACFC\uC5D0 \uB300\uD558\uC5EC \uC911\uC694\uD55C \uC758\uBBF8\uB97C \uAC00\uC9C0\uAE30 \uB54C\uBB38\uC5D0 \uB204\uAD6C\uB098 \uC5B4\uB5A4 \uC7A5\uC18C\uC5D0\uC11C \uC790\uC2E0\uC774 \uACC4\uD68D\uD55C \uC9D1\uD68C\uB97C \uD560 \uAC83\uC778\uAC00\uB97C \uC6D0\uCE59\uC801\uC73C\uB85C \uC790\uC720\uB86D\uAC8C \uACB0\uC815\uD560 \uC218 \uC788\uC5B4\uC57C\uB9CC \uBE44\uB85C\uC18C \uC9D1\uD68C\uC758 \uC790\uC720\uAC00 \uD6A8\uACFC\uC801\uC73C\uB85C \uBCF4\uC7A5\uB41C\uB2E4.",
