  "text" : "\uACB0\uC815\uC9D3\uB294 \uACBD\uC6B0\uAC00 \uC801\uC9C0 \uC54A\uB2E4. \uC9D1\uD68C\uAC00 \uAD6D\uAC00\uAD8C\uB825\uC5D0 \uC758\uD558\uC5EC \uC138\uC778\uC758 \uC8FC\uBAA9\uC744 \uBC1B\uC9C0 \uBABB\uD558\uB294 \uC7A5\uC18C\uB098 \uC9D1\uD68C\uC5D0\uC11C \uD45C\uBA85\uB418\uB294 \uC758\uACAC\uC5D0 \uB300\uD558\uC5EC \uC544\uBB34\uB3C4 \uADC0\uB97C \uAE30\uC6B8\uC774\uC9C0 \uC54A\uB294 \uC7A5\uC18C\uB85C \uCD94\uBC29\uB41C\uB2E4\uBA74, \uAE30\uBCF8\uAD8C\uC758 \uBCF4\uD638\uAC00 \uC0AC\uC2E4\uC0C1 \uADF8 \uD6A8\uB825\uC744 \uC783\uAC8C \uB41C\uB2E4\uB294 \uC810\uC5D0\uC11C \uC9D1\uD68C\uC758 \uC790\uC720\uC5D0 \uC788\uC5B4\uC11C",
