  "text" : "\uAD70\uAC00\uC0B0\uC810\uC758 \uB300\uC548\uC73C\uB85C \uB098\uC624\uB294 \uD559\uC790\uAE08 \uC9C0\uC6D0\uC774\uB098 \uC804\uC5ED\uC77C\uC2DC\uAE08 \uC9C0\uAE09 \uB4F1\uC758 \uC81C\uB300\uAD70\uC778\uC9C0\uC6D0\uCC45\uC5D0 \uB300\uD574 \"\uC7AC\uC6D0\uC744 \uC5B4\uB5BB\uAC8C \uB9C8\uB828\uD560 \uAC83\uC778\uAC00!\" \uB77C\uB294 \uBD84\uB4E4\uC774 \uACC4\uC2DC\uB294\uB370, (\uBBF8\uD544\uC790\uB97C \uB300\uC0C1\uC73C\uB85C \uD558\uB294 \uAD70\uC5ED\uD615\uD3C9\uC870\uC138 \uB4F1\uC740 \uCC28\uCE58\uD558\uACE0\uC11C\uB77C\uB3C4) \uC6B0\uB9AC\uC5D0\uAC8C\uB294 '\uBCF5\uAD8C\uBC1C\uD589' \uC774\uB780 \uB9C8\uBC95\uAC19\uC740 \uC544\uC774\uD15C\uC774..",
