  "text" : "\uD558\uB098\uC529 \uB5BC\uC5B4\uB193\uACE0 \uC0DD\uAC01\uD55C\uB2E4\uBA74 '\uC81C\uB300\uAD70\uC778 \uC9C0\uC6D0\uCC45 \uC608\uC0B0\uC740 \uB300\uCCB4 \uC5B4\uB5BB\uAC8C \uB9C8\uB828\uD560\uAC70\uB0D0, \uD5C8\uBB34\uB9F9\uB791\uD55C \uC18C\uB9AC\uB2E4' \uC2DD\uC758 \uB4DC\uB9BD\uC5D0 '\uADF8\uB7FC \uC5B4\uB5A4 \uC608\uC0B0\uC73C\uB85C \uC5EC\uC131\uB3C4 \uC758\uBB34\uBCF5\uBB34\uB97C \uC2DC\uD0A4\uC2DC\uACA0\uB2E4\uB294\uAC70\uC8E0?' \uB4F1\uC758 \uC5ED\uACF5\uACA9\uC744 \uD560 \uC218\uB3C4 \uC788\uB294\uB370, \uC774\uC815\uB3C4 \uAE09\uC758 \uBED8\uC18C\uB9AC\uAC00 \uD55C\uAEBC\uBC88\uC5D0 \uB098\uC624\uB2E4\uBCF4\uB2C8 \uACFC\uBD80\uD558..",
