  "text" : "\uC774 \uB9DD\uC0C1\uB3C4 \uAE4C\uC57C \uD558\uACE0, \uC800 \uCC29\uAC01\uB3C4 \uAE4C\uC57C \uD558\uACE0, \uC694 \uC2E4\uC5B8\uB3C4 \uAE4C\uC57C \uD558\uACE0, \uC8E0 \uBB34\uC2DD\uB3C4 \uAE4C\uC57C\uD558\uACE0.. \uD55C\uB9C8\uB514 \uD55C\uB9C8\uB514 \uAE54\uAC8C \uB108\uBB34 \uB9CE\uB2E4\uBCF4\uB2C8 \uB098\uC911\uC5D0\uB294 \uB0B4\uAC00 \uC5B4\uB514\uC5D0 \uB313\uAE00\uC744 \uB2EC\uC544\uC57C \uD560\uC9C0\uB3C4 \uBAA8\uB974\uACA0\uACE0, \uD55C \uD2B8\uC717\uB2F9 \uC11C\uB108\uD2B8\uC717 \uC774\uC0C1\uC529\uC758 \uC7C1\uC810\uC744 \uB358\uC838\uC8FC\uB2C8 \uC218\uC9C0\uD0C0\uC0B0\uC774 \uC548\uB9DE\uC544\uC11C \uC9C0\uCE68.",
