  "text" : "\uCD1D\uAE30\uAC00 \uC0AC\uC6A9\uB418\uB294 \uACBD\uC6B0\uB294 \uC815\uB9D0\uC815\uB9D0 \uC704\uAE09\uD55C \uC0C1\uD669\uC77C \uACBD\uC6B0\uC5D0 \uAD6D\uD55C\uB418\uBA70, \uB2E4\uC74C\uACFC \uAC19\uC740 \uAE30\uC900\uC5D0 \uC758\uD574\uC11C \uC9D1\uD68C \uBC0F \uC2DC\uC704\uB97C \uD574\uC0B0\uC2DC\uD0B5\uB2C8\uB2E4. (\uBBF8\uAD6D\uC774 \uC2DC\uC704\uB300\uC5D0\uAC8C \uCD1D\uC9C8\uD558\uACE0 \uADF8\uB7EC\uB294 \uBBF8\uAC1C\uD55C \uB098\uB77C\uB77C\uACE0 \uC0DD\uAC01\uD558\uC168\uB2E4\uBA74 \uC808\uB300 \uC624\uC0B0\uC774\uC9C0 \uB9D0\uC785\uB2C8\uB2E4) http:\/\/t.co\/lMWp2c64j5",
