  "text" : "\uBBF8\uAD6D\uC5D0\uC11C\uC758 \uC2DC\uC704\uB300 \uAC15\uC81C\uD574\uC0B0\uC5D0 \uD5C8\uC6A9\uB418\uB294 \uBB3C\uB9AC\uC801 \uC218\uB2E8\uC740 \uC624\uD1A0\uBC14\uC774, \uACBD\uCC30\uCC28\uB97C \uD3EC\uD568\uD55C \uC774\uB3D9\uBCD1\uB825\uC758 \uACFC\uC2DC\uB098 \uC2DC\uC704\uB300 \uD3EC\uC704\uC640 \uC218\uC778\uC758 \uB3D9\uC2DC\uCCB4\uD3EC, \uC2DC\uC704\uB300\uB97C \uC774\uB3D9\uC2DC\uD0A4\uAE30 \uC704\uD55C \uACBD\uCC30\uBC30\uC5F4\uACFC \uACBD\uCC30\uBD09\uC758 \uC0AC\uC6A9, \uBE44\uBD84\uC0AC\uD615\uC2DD\uC758 \uC2DC\uC704\uB300 \uD1B5\uC81C \uD654\uD559\uC57D\uD488, \uC74C\uD5A5\uACFC \uC870\uBA85 \uB4F1 \uCDA9\uACA9\uAE30\uAE30 \uC815\uB3C4\uC785\uB2C8\uB2E4",
