  "text" : "\uBB50 \uD22D\uD558\uBA74 '\uBBF8\uAD6D\uC5D0\uC11C\uB294 \uC2DC\uC704\uD558\uB294 \uB188\uB4E4\uC5D0\uAC8C \uCD1D\uC744 \uC3F4\uC11C \uC989\uC2DC \uC0AC\uC0B4\uD55C\uB2E4' \uBB50 \uC774\uB7F0 \uBD84\uB4E4\uB3C4 \uACC4\uC2DC\uB358\uB370, \uC5B4\uB9BC \uBC18\uD47C\uC5B4\uCE58\uB3C4 \uC5C6\uB294 \uC18C\uB9AC\uC785\uB2C8\uB2E4. \uBBF8\uAD6D\uC740 \uD558\uB2E4\uBABB\uD574 \uC0B4\uC218\uCC28\uC870\uCC28 '\uC2DC\uC704\uB300 \uD1B5\uC81C, \uC2DC\uC704\uB300 \uBD09\uC1C4\uB098 \uAC15\uC81C\uD574\uC0B0\uC758 \uC6A9\uB3C4\uB85C \uC0AC\uC6A9\uD560 \uC218 \uC5C6\uB3C4\uB85D' \uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4.",
