  "text" : "\uB3C5\uC77C\uC740 \uC9D1\uD68C\uB97C \uC704\uD55C \uC0AC\uC804 \uC900\uBE44\uD589\uC704\uC640 \uC9D1\uD68C\uC5D0 \uCC38\uAC00\uD558\uAE30 \uC704\uD574 \uC9D1\uD68C\uC7A5\uC18C\uB85C \uC774\uB3D9\uD558\uB294 \uD589\uC704 \uB4F1\uB3C4 \uC9D1\uD68C\uC758 \uAE30\uBCF8\uAD8C\uC73C\uB85C \uBCF4\uD638\uD569\uB2C8\uB2E4. \uACBD\uCC30\uC758 \uD3F4\uB9AC\uC2A4 \uB77C\uC778 \uB4F1\uC73C\uB85C \uC778\uD574 \uCC38\uAC00\uC790\uAC00 \uC9D1\uD68C\uC7A5\uC18C\uC5D0 \uB3C4\uCC29\uD560 \uC218 \uC5C6\uB2E4\uBA74, \uADF8\uAC83\uBD80\uD130\uB97C \uC9D1\uD68C\uC758 \uC790\uC720\uC5D0 \uB300\uD55C \uC704\uBC95\uD55C \uCE68\uD574\uB85C \uBCF4\uB294\uAC70\uC8E0.",
