  "text" : "\uC77C\uBD80\uB7EC \uC2DC\uC704\uB300 \uC0AC\uC774\uC5D0\uB2E4\uAC00 \uD3F4\uB9AC\uC2A4 \uB77C\uC778\uC744 \uC124\uCE58\uD574\uC11C \uC2DC\uC704\uB300\uC640\uC758 \uCDA9\uB3CC\uC744 \uC720\uB3C4\uD558\uACE0, \uC9D1\uD68C\uAC00 \uC608\uC815\uB41C \uC7A5\uC18C\uC5D0\uB2E4 \uC804\uACBD\uB300\uB098 \uBC84\uC2A4\uB97C \uBC30\uCE58\uD574\uC11C \uC54C\uBC15\uAE30\uB098 \uD558\uBA74\uC11C \uC77C\uBD80\uB7EC \uBD88\uBC95\uC2DC\uC704\uB97C \uC720\uB3C4\uD558\uB294 \uAC83\uC774 \uACBD\uCC30\uC758 \uC2DC\uC704\uB300\uCC45 \uC544\uB2C8\uC5C8\uB098 \uC2F6\uC740\uB370 \uB9D0\uC774\uC9C0\uB77C.\n\n\uC720\uB3C4\uB41C \uBD88\uBC95\uC774\uB77C\uAD6C\uC694. \uC720\uB3C4\uB41C \uBD88\uBC95",
