  "text" : "\uCD08\uB798\uD558\uAC70\uB098 \uAD50\uD1B5 \uC18C\uD1B5\uC744 \uC800\uD574\uD560 \uC218\uBC16\uC5D0 \uC5C6\uACE0, \uC9D1\uD68C\uAC00 \uAC1C\uCD5C\uB41C\uB2E4 \uD558\uB354\uB77C\uB3C4 \uC8FC\uBCC0 \uAD50\uD1B5 \uC18C\uD1B5\uC774 \uC2EC\uAC01\uD558\uAC8C \uC800\uD574\uB41C\uB2E4\uACE0 \uBCF4\uAE30 \uC5B4\uB824\uC6C0\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uC9D1\uD68C\uAE08\uC9C0\uD1B5\uBCF4\uB97C \uD55C \uAC83\uC740 '\uC704\uBC95'\uD558\uC9C0 \uB9D0\uC785\uB2C8\uB2E4. \uC2DC\uC704\uAC00 \uBD88\uBC95\uC774 \uB418\uB294 \uAC00\uC7A5 \uD070 \uC774\uC720 \uC911 \uD558\uB098\uB294 \uC704\uBC95\uD55C \uC9D1\uD68C\uAE08\uC9C0\uD1B5\uBCF4 \uB54C\uBB38\uC784\uC694",
