  "text" : "\uC608\uC678 \uC5C6\uC774 \uC808\uB300\uC801\uC73C\uB85C \uAE08\uC9C0\uB418\uC5C8\uB2E4.\n\n\uC774\uD6C4 \uC601\uAD6C\uC9D1\uAD8C\uC744 \uAE30\uB3C4\uD55C \uBC15\uC815\uD76C \uC815\uBD80\uB294 1972\uB144 \uC81C7\uCC28 \uD5CC\uBC95\uAC1C\uC815(\uC720\uC2E0\uD5CC\uBC95)\uC744 \uD1B5\uD558\uC5EC \uAE30\uBCF8\uAD8C\uC744 \uB354\uC6B1 \uC81C\uD55C\uD560 \uC218 \uC788\uAC8C \uAC1C\uBCC4\uC801 \uBC95\uB960\uC720\uBCF4\uB97C \uADDC\uC815\uD558\uC600\uB2E4. \uB610\uD55C \uC9D1\uD68C\uC5D0 \uB300\uD55C \uD5C8\uAC00\uC81C \uAE08\uC9C0\uADDC\uC815\uC744 \uC0AD\uC81C\uD558\uC600\uACE0(\uD5CC\uBC95 \uC81C18\uC870),",
