  "text" : "\uC989, \uC81C\uC815 \uC9D1\uC2DC\uBC95\uC740 \uD5CC\uBC95\uC774 \uBCF4\uC7A5\uD558\uB294 \uC9D1\uD68C\uC758 \uC790\uC720\uB97C \uBCF4\uD638\uD558\uB824\uB294 \uC758\uB3C4\uAC00 \uC544\uB2C8\uB77C \uAD6D\uBBFC\uB4E4\uC758 \uC9D1\uD68C\uB97C \uC5B5\uC555\uD558\uB824\uB294 \uCE21\uBA74\uC5D0\uC11C \uADDC\uC815\uB418\uC5C8\uB2E4. \uC774\uB7EC\uD55C \uC758\uB3C4\uC5D0 \uBD80\uD569\uD558\uB294 \uC870\uD56D\uB4E4 \uC911 \uD558\uB098\uAC00 \uB2F9\uC2DC \uC9D1\uC2DC\uBC95 \uC81C6\uC870\uC5D0 \uADDC\uC815\uB41C \uC57C\uAC04\uC625\uC678\uC9D1\uD68C\uAE08\uC9C0 \uC870\uD56D\uC774\uB2E4. \uC774 \uADDC\uC815\uC5D0 \uC758\uD558\uC5EC \uC57C\uAC04\uC625\uC678\uC9D1\uD68C\uB294",
