  "text" : "\uBE44\uC815\uC0C1\uC801\uC73C\uB85C \uC815\uAD8C\uC744 \uC7A1\uC740 \uBC15\uC815\uD76C \uB4F1\uC740 \uC5EC\uB7EC \uC785\uBC95\uC744 \uD1B5\uD558\uC5EC \uAD6D\uBBFC\uC758 \uAE30\uBCF8\uAD8C\uC744 \uC81C\uD55C\uD558\uACE0\uC790 \uD558\uC600\uB2E4. \uC774\uB7EC\uD55C \uB9E5\uB77D\uC5D0\uC11C 1962\uB144 12\uC6D4 31\uC77C \uC9D1\uD68C\uBC0F\uC2DC\uC704\uC5D0\uAD00\uD55C\uBC95\uB960\uC744 \uC81C\uC815\uD558\uC5EC \uAD70\uC0AC\uC815\uAD8C \uC9D1\uAD8C\uC5D0 \uBC18\uB300\uD558\uB294 \uC138\uB825 \uB4F1 \uBE44\uD310\uC801 \uBAA9\uC18C\uB9AC\uB97C \uC0AC\uC804\uC5D0 \uC81C\uD55C\uD558\uB824\uB294 \uC758\uB3C4\uB97C \uB4DC\uB7EC\uB0B4\uC5C8\uB2E4.",
