  "text" : "\uAD8C\uB825\uC740 \uC9C8\uC11C\uC720\uC9C0, \uACF5\uACF5\uC758 \uC548\uC804\uC744 \uBA85\uBD84\uC73C\uB85C \uADF8\uB7EC\uD55C \uD45C\uD604\uC774 \uAD11\uBC94\uC704\uD558\uAC8C \uBCF4\uC7A5\uB418\uC5B4\uC57C \uD560 \uBBFC\uC8FC\uC8FC\uC758 \uC2E4\uD604\uACFC\uC815\uC758 \uD575\uC2EC\uC801 \uACF5\uAC04(\uC608\uCEE8\uB300, \uC758\uD68C, \uBC95\uC6D0, \uACE0\uC704\uACF5\uC9C1\uC790\uC758 \uC9D1\uBB34\uACF5\uAC04 \uB4F1)\uC5D0\uC11C\uC758 \uC9D1\uD68C\uB97C \uC808\uB300\uC801\uC73C\uB85C \uAE08\uC9C0\uD558\uACE0 \uC788\uB2E4(\uC9D1\uC2DC\uBC95 \uC81C11\uC870). \uC774\uB807\uAC8C \uD568\uC73C\uB85C\uC368 \uACF5\uAC04\uACFC",
