  "text" : "\uAD8C\uB825\uC774 \uC758\uB3C4\uD558\uB294 \u201C\uADDC\uC728\uC0AC\uD68C(disciplinary society)\u201D\uB97C \uB9CC\uB4DC\uB294\uB370 \uC801\uC6A9\uB41C\uB2E4.\n\n\uC9D1\uD68C\u2024\uC2DC\uC704\uC758 \uC790\uC720\uC5D0 \uB300\uD55C \uC7A5\uC18C\uC801 \uC81C\uD55C\uB3C4 \uC774\uC640 \uC815\uD655\uD788 \uB3D9\uC77C\uD55C \uC5ED\uD560\uC744 \uC218\uD589\uD55C\uB2E4. \uC9D1\uB2E8\uC801 \uC2DC\uBBFC\uC758 \uC758\uC0AC\uD45C\uCD9C, \uC9C0\uBC30\uC801 \uAC00\uCE58\uC640 \uB2E4\uB978 \uC0DD\uAC01\uC744 \uAC00\uC9C4 \uC18C\uC218\uC790\uC758 \uC758\uC0AC\uC804\uB2EC\uC5D0 \uB300\uD574",
