  "text" : "\uBB3C(\u7269, res)\uC774 \uC544\uB2C8\uBA70, \uACF5\uAC04\uC804\uC220\uB4E4\uC740 \uAD8C\uB825\uC774 \uB300\uD56D\uAD8C\uB825(counter-power)\uC744 \uBB34\uB825\uD654\uC2DC\uD0A4\uAE30 \uC704\uD574 \uCC44\uD0DD\uD558\uB294 \uC815\uCE58\uC801\uC774\uACE0 \uBAA9\uC801\uC801\uC778 \uAE30\uC220\uC774\uB77C\uB294 \uAC83\uC774\uB2E4. \uC774 \uACF5\uAC04\uC804\uC220\uC740 \uAC10\uC625\uC774\uB098 \uD559\uAD50\uAC19\uC740 \uC7A5\uC18C\uC5D0\uB9CC \uAD6D\uD55C\uB418\uC9C0 \uC54A\uACE0, \uB300\uBD80\uBD84\uC758 \uACF5\uC801\u00B7\uC0AC\uD68C\uC801 \uC7A5\uC18C\uC5D0 \uC601\uD5A5\uC744 \uBBF8\uCCD0",
