  "text" : "\uADF8 \uBD84\uD560\uC774 \uAC00\uC838\uC624\uB294 \uC9C8\uC11C\uC720\uC9C0, \uD1B5\uC81C, \uAC10\uC2DC, \uBD84\uB9AC, \uADF8\uB9AC\uACE0 \uB099\uC778\uC758 \uD6A8\uACFC \uB54C\uBB38\uC5D0 \uAD8C\uB825\uC790\uB4E4\uC5D0 \uC758\uD574 \uC120\uD638\uB41C\uB2E4. \uBB34\uC9C8\uC11C\uC640 \uBC18\uB300\uC640 \uC800\uD56D\uC744 \uC5B5\uC555\uD558\uAE30 \uC704\uD574 \uAD6D\uAC00\uAD8C\uB825\uC740 \uC7A5\uC18C\uB97C \uD6A8\uACFC\uC801\uC73C\uB85C \uAD00\uB9AC\uD558\uAE30 \uC704\uD55C \uAE30\uC220\uB4E4\uC744 \uBC1C\uC804\uC2DC\uCF1C\uC654\uB2E4. \uC694\uCEE8\uB300, \uD478\uCF54\uC758 \uAD00\uCC30\uC5D0\uC11C \uACF5\uAC04\uC740 \uB2E8\uC21C\uD788",
