  "text" : "\uD6A8\uACFC\uC801\uC774\uACE0 \uC815\uD655\uD55C \uADDC\uC728\uC758 \uC801\uC6A9\uACFC \uD1B5\uC81C\uB97C \uC218\uD589\uD574 \uB098\uAC04\uB2E4. \uACF5\uAC04\uC804\uC220\uB4E4\uC758 \uACF5\uD1B5\uC801 \uBAA9\uC801\uC740 \uB2E4\uB978 \uADF8\uB8F9\uC5D0 \uB300\uD55C \uD55C \uADF8\uB8F9\uC758 \uAD8C\uB825\uC758 \uC720\uC9C0-\uAC04\uC218\uC640 \uC8C4\uC218, \uC0AC\uC6A9\uC790\uC640 \uB178\uB3D9\uC790, \uC758\uB8CC\uC9C4\uACFC \uD658\uC790, \uAC70\uC8FC\uC790\uC640 \uC678\uBD80\uC790, \uD1B5\uCE58\uC790\uC640 \uD53C\uCE58\uC790\uAC04-\uC5D0 \uC788\uC73C\uBA70, \uACF5\uAC04\uC5D0 \uB300\uD55C \uACC4\uC0B0\uB41C \uBD84\uD560\uC740",
