  "text" : "\uADF8 \uACB0\uACFC \uC2E4\uC81C \uC7AC\uD310\uC5D0 \uCC38\uC5EC\uD558\uC9C0 \uC54A\uC740 \uC77C\uBC18\uC778\uB4E4\uC740 \uC81C\uD55C\uB41C \uC815\uBCF4\uB9CC\uC744 \uC81C\uACF5\uBC1B\uAC8C \uB418\uACE0, \uC790\uADF9\uC801\uC778 \uC81C\uBAA9\uACFC \uAC01\uC0C9\uB41C \uBCF8\uBB38\uB9CC \uAC00\uC9C0\uACE0 \uD310\uB2E8\uC744 \uD574\uC57C \uD558\uB2E4\uBCF4\uB2C8 \"\uC800\uAC70 \uB2E4 \uCC22\uC5B4\uC8FD\uC5EC\uC57C \uD558\uB294\uB370. \uBC94\uC8C4\uC790\uB791 \uD310\uC0AC \uB2E4 \uB098\uC05C \uC0C8\uB07C\" \uC774\uB7F0 \uACB0\uB860\uC774 \uB098\uC624\uB294 \uAC83\uC740 \uC5B4\uCC0C\uBCF4\uBA74 \uD544\uC5F0\uC801\uC778 \uACB0\uACFC\uC77C\uC9C0\uB3C4",
