  "text" : "\uD3C9\uADE0 19\uC138, 4\uBC94\uC774\uC5C8\uC73C\uBA70, \uBA74\uC2DD\uAD00\uACC4\uAC00 \uC5C6\uB294 \uD53C\uD574\uC790\uB4E4\uC744 \uB300\uC0C1\uC73C\uB85C \uAC80\uAC70\uB420 \uB54C\uAE4C\uC9C0 \uD3C9\uADE0 8.5\uD68C \uC815\uB3C4\uC758 \uBC94\uD589\uC744 \uC9C0\uC18D\uD588\uB2E4. \uC0AC\uC774\uCF54\uD328\uC2A4\uD615 \uC5F0\uC1C4\uC0B4\uC778\uBC94\uC758 \uCD9C\uD604\uB3C4 \uB450\uB4DC\uB7EC\uC84C\uB2E4. \uC774\uB7EC\uD55C \uACB0\uACFC\uB294 \uC55E\uC11C \uAC80\uD1A0\uD55C Holmes \uFF06 DeBurger(1988)\uC758",
