  "text" : "\uBC18\uC0AC\uD68C\uC801 \uAE30\uC9C8\uC744 \uAC00\uC9C0\uACE0 \uC788\uC73C\uBA70 \uC120\uCC9C\uC801\uC778 \uAE30\uC9C8\uC774 \uAC15\uD558\uB2E4.\n\n\uD55C\uAD6D\uC758 \uB300\uD45C\uC801\uC778 \uC5F0\uC1C4\uC0B4\uC778 \uBC0F \uC5F0\uC1C4\uC131 \uC0B4\uC778 23\uC0AC\uAC74(\uC2DC\uB9AC\uC988)\uC744 \uBD84\uC11D\uD55C \uC5F0\uAD6C \uACB0\uACFC\uB97C \uC694\uC57D\uD558\uBA74, \uB300\uBD80\uBD84 \uB2E8\uB3C5\uBC94\uC774\uACE0 \uBBF8\uD63C\uC778 \uC5F0\uC1C4\uC0B4\uC778\uBC94\uC740 2,30\uB300\uC758 \uBC94\uC8C4\uC790\uAC00 \uB300\uB2E4\uC218\uC600\uACE0, \uCD08\uBC94\uC5F0\uB839\uACFC \uC804\uACFC\uACBD\uB825\uC740",
