  "text" : "\uD53C\uD574\uC790\uAC00 \uACE0\uD1B5\uC2A4\uB7EC\uC6CC\uD558\uB294 \uAC83\uC744 \uC990\uAE30\uBA70 \uD53C\uD574\uC790\uC758 \uC0DD\uC0AC \uD1B5\uC81C\uAD8C\uC744 \uD1B5\uD574 \uB9CC\uC871\uAC10\uC744 \uCD94\uAD6C\uD55C\uB2E4.\n\n\uC5F0\uC1C4\uC0B4\uC778\uBC94\uACFC \uD53C\uD574\uC790\uC758 \uAD00\uACC4\uC5D0 \uAD00\uD55C Pakhomou\uC758 \uC5F0\uAD6C(2004: 222-223)\uC5D0\uC11C\uB294 \uC5F0\uC1C4\uC0B4\uC778\uBC94\uC758 \uC778\uAD6C\uC0AC\uD68C\uD559\uC801 \uD1B5\uACC4\uB97C \uC81C\uC2DC\uD558\uACE0 \uC788\uB2E4. \uC5F0\uC1C4\uC0B4\uC778\uBC94\uC758 \uD3C9\uADE0\uC5F0\uB839\uC740",
