  "text" : "\uD53C\uD574\uC790\uB294 \uC57D\uD558\uACE0 \uC218\uB3D9\uC801\uC778 \uAC1C\uC778\uC73C\uB85C\uC11C \uACF5\uACA9\uC801 \uC0C1\uD669\uC5D0\uC11C \uBC97\uC5B4\uB098\uB824\uACE0 \uD558\uACE0, \uAC00\uD574\uC790\uB294 \uC794\uC778 \uD558\uACE0 \uAC15\uD558\uACE0 \uC9C0\uB098\uCE58\uAC8C \uACF5\uACA9\uC801\uC778 \uC0AC\uB78C\uC73C\uB85C\uC11C \uD53C\uD574\uC790\uB97C \uCC3E\uB294\uB2E4\uB294 \uAC83\uC774 \uD56D\uC0C1 \uB9DE\uB294 \uAC83\uC774 \uC544\uB2D8\uC744 \uC9C0\uC801\uD558\uACE0 \uC788\uB2E4. \uAC00\uD574\uC790\uC640 \uD53C\uD574\uC790 \uC5ED\uD560\uC5D0 \uAD00\uD55C \uD568\uCD95\uC131\uC740 \uB137\uC911 \uD558\uB098\uAC00 \uC81C\uAC70\uB418\uAC70\uB098",
