  "text" : "\uBB34\uC8C4\uB85C \uC778\uC815\uB418\uB294 \uACBD\uD5A5\uC774 \uC788\uB2E4(Glick and J. Mitchell Miller, 2007: 251). \n\nVolfgang\uC740 \uC0B4\uC778\uC0AC\uAC74 \uC5F0\uAD6C\uC5D0\uC11C \uD53C\uD574\uC790\uB294 \uAC00\uD574\uC790\uC758 \uD2B9\uC9D5 \uB300\uBD80\uBD84\uC744 \uAC00\uC9C0\uACE0 \uC788\uB2E4\uACE0 \uD55C\uB2E4. \uADF8\uB9AC\uACE0 \uD53C\uD574\uC790\uC5D0 \uB300\uD55C \uACE0\uC815\uAD00\uB150\uC5D0 \uC774\uC758\uB97C \uC81C\uAE30\uD558\uC5EC,",
