  "text" : "\uB69C\uB837\uD55C \uB3D9\uAE30 \uC5C6\uB294 \uC0B4\uC778\uC790\uB4E4\uC740 \uB3D9\uAE30\uB97C \uAC00\uC9C0\uACE0 \uC788\uB294 \uC790\uB4E4\uACFC \uBE44\uAD50\uD560 \uB54C, \uB2E4\uC74C\uACFC \uAC19\uC740 \uD2B9\uC9D5\uC744 \uAC00\uC9C8 \uAC00\uB2A5\uC131\uC774 \uB354 \uD06C\uB2E4. \uC54C\uCF54\uC62C \uB0A8\uC6A9\uC804\uB825\uC774 \uC5C6\uC74C; \uAD50\uB3C4\uC18C\uC5D0\uC11C \uCD5C\uADFC \uCD9C\uC18C; \uBC94\uD589\uC2DC \uAE30\uC5B5\uC0C1\uC2E4 \uC8FC\uC7A5; \uBC94\uD589 \uBD80\uC778; \uC815\uC2E0\uBCD1\uC801 \uD589\uB3D9\uC744 \uBCF4\uC5EC \uBC94\uD589\uC5D0 \uC774\uB974\uACE0 \uC815\uC2E0\uC9C8\uD658\uC744 \uC774\uC720\uB85C",
