  "text" : "\uC131\uC801 \uAD6C\uC131\uC694\uC18C\uB294 \uBC18\uB4DC\uC2DC \uC874\uC7AC\uD558\uB294 \uAC83\uC774 \uC544\uB2C8\uB2E4. \uC774\uB7EC\uD55C \uC0B4\uC778\uBC94\uB4E4\uC740 \uD2B9\uBCC4\uD558\uAC8C \uCDE8\uC57D\uD574 \uBCF4\uC774\uAC70\uB098 \uAE30\uB9CC\uD558\uAE30 \uC26C\uC6CC \uBCF4\uC774\uB294 \uD2B9\uC815 \uD53C\uD574\uC790\uB97C \uCC3E\uB294 \uACBD\uD5A5\uC744 \uBCF4\uC778\uB2E4. \n\nHolcomb \uB4F1(1988)\uC5D0 \uC758\uD558\uBA74 \uBAA8\uB4E0 \uC0B4\uC778\uC0AC\uAC74\uC758 4\uBD84\uC758 1 \uC815\uB3C4\uB294 \uB3D9\uAE30\uAC00 \uBD84\uBA85\uD558\uC9C0 \uC54A\uC740\uB370,",
