  "text" : "\uC0AC\uC548\uC5D0 \uB300\uD55C \uBE44\uB09C\uC758 \uB300\uC0C1\uC744 \uCC3E\uC544\uC57C \uD55C\uB2E4\uBA74 \uC774\uB294 \uC0AC\uBC95\uBD80\uAC00 \uC544\uB2CC, \uC800\uB7EC\uD55C \uC2DC\uB300\uCC29\uC624\uC801(?)\uC778 \uB300\uD1B5\uB839\uB839\uC744 \uC815\uBE44\uD558\uC9C0 \uC54A\uACE0 \uC788\uB294 \uD589\uC815\uBD80\uAC00 \uB418\uC5B4\uC57C \uD558\uC9C0 \uC54A\uACA0\uB098 \uC2F6\uC740\uB370.. \uC5EC\uD2BC, \uC774\uB7F0 \uC2DD\uC73C\uB85C \uD574\uB2F9 \uADDC\uC815\uC758 \uBB38\uC81C\uAC00 \uB4DC\uB7EC\uB0AC\uC73C\uBBC0\uB85C \uD589\uC815\uBD80\uB294 \uC870\uC18D\uD788 \uAC1C\uC815\uC791\uC5C5\uC5D0 \uCC29\uC218\uD574\uC57C \uD560 \uAC83",
