  "text" : "\uC544\uC774\uC758 \uD559\uAD50 \uD589\uC0AC\uB098 \uB180\uC774, \uCE5C\uAD6C\uC758 \uC0DD\uC77C\uD30C\uD2F0 \uB4F1\uC5D0 \uC544\uC774\uC640 \uD568\uAED8 \uCC38\uC11D\uD558\uB294 \uAC83\uC774 \uC81C\uD55C\uB418\uC5C8\uB2E4\uACE0 \uC751\uB2F5\uD558\uC600\uC2B5\uB2C8\uB2E4.\n\n\uC774\uCC98\uB7FC \uC2E0\uC0C1\uACF5\uAC1C\uC758 \uB300\uC0C1\uC774 \uB41C \uBC94\uC8C4\uC790\uB294 \uBB3C\uB860 \uADF8\uB4E4\uC758 \uAC00\uC871\uB4E4\uC5D0\uAC8C\uAE4C\uC9C0\uB3C4 \uC131\uBC94\uC8C4\uC640 \uAD00\uB828\uC774 \uC788\uB2E4\uB294 \uC774\uC720\uB9CC\uC73C\uB85C \uAD34\uB86D\uD798\uC774\uB098 \uC5B8\uC5B4\uC801 \uD3ED\uB825\uC740 \uBB3C\uB860 \uD3ED\uB825, \uADF8\uB9AC\uACE0",
