  "text" : "\uB178\uB294 \uAC83\uC744 \uC8FC\uC800\uD558\uAC70\uB098(70%) \uB300\uC0C1\uC790\uC758 \uC544\uC774\uAC00 \uCE5C\uAD6C\uC758 \uC9D1\uC5D0\uC11C \uB178\uB294 \uAC83\uC744 \uC8FC\uC800\uD55C\uB2E4(56%)\uACE0 \uC751\uB2F5\uD588\uC2B5\uB2C8\uB2E4. \uADF8\uB9AC\uACE0 \uC2E0\uC0C1\uACF5\uAC1C\uC790\uC758 71%\uAC00 \uC790\uC2E0\uC758 \uC544\uC774\uB4E4\uC5D0\uAC8C \uC131\uBC94\uC8C4\uC790\uC758 \uC790\uB140\uB77C\uB294 \uB099\uC778\uC774 \uCC0D\uD614\uB2E4\uACE0 \uC751\uB2F5\uD588\uACE0, 74%\uB294 \uC2E0\uC0C1\uC774 \uACF5\uAC1C\uB41C \uC131\uBC94\uC8C4\uC790\uC778 \uC544\uC774\uC758 \uBD80\uBAA8\uAC00",
