  "text" : "\uC5EC\uAE30\uB294 \uAE30\uC0AC\uB97C \uC77D\uB2E4\uAC00\uB3C4, \uC9C0\uB098\uCE58\uAC8C \uD55C \uC815\uD30C\uC758 \uC785\uC7A5\uB9CC \uB300\uBCC0\uD55C\uB2E4\uB294 \uB290\uB08C\uC774 \uB4E4\uC5B4\uC11C \uC0AC\uC774\uD2B8\uB97C \uB2EB\uAC8C \uB418\uB294 \uACBD\uC6B0\uAC00.. \uD2B8\uC704\uD130 \uC720\uBA85 \uB17C\uAC1D\uB4E4\uC758 \uC5EC\uB2F9\uACFC \uC815\uBD80 \uBE44\uD310\uC774 \uC8FC \uAE30\uC0AC\uAC70\uB9AC\uC778 \uAC83\uC774 \uC0AC\uC2E4\uC774\uACE0, \uB54C\uB85C\uB294 \uBC95\uC870\uC2E4\uBB34\uB098 \uC785\uBC95\uAD00\uB828 \uB274\uC2A4 \uB4F1\uBCF4\uB2E4 \uB354 \uBE44\uC911\uC788\uAC8C \uB2E4\uB904\uC9C0\uB2C8 \uAC70 \uCC38..",
